import logo from "./logo.svg";
import "./App.css";

function App() {
  return <Layout />;
}

function Layout() {
  return (
    <div className="layout">
      <Form />
      <Header />
      <Todo />
      <List />
    </div>
  );
}

function Form() {
  return (
    <div className="form">
      <span>My Todo List</span>
      <span>React</span>
    </div>
  );
}
function Header() {
  return (
    <div className="header">
      제목 <input type="text" />
      내용 <input type="text" />
      <button>추가하기</button>
    </div>
  );
}

function Todo() {
  return (
    <div className="todo">
      <span>Working..</span>
      <div>
        <h4>리액트 공부하기</h4>
        <span>리액트 기초를 공부해봅시다</span>
        <button>삭제하기</button>
        <button>완료</button>
      </div>
    </div>
  );
}

function List() {
  return (
    <div className="list">
      <span>Done..!</span>
      <div>
        <h4>리액트 공부하기</h4>
        <span>리액트 기초를 공부해봅시다</span>
        <button>삭제하기</button>
        <button>완료</button>
      </div>
    </div>
  );
}

export default App;
